## 큐(Queue)란?

- FIFO(first in first out) 먼저 들어온 데이터가 먼저 나간다.
- 데이터 삽입 (Enqueue)
- 데이터 삭제 (Dequeue)
- 큐는 순서대로 처리해야하는 작업을 임시로 저장해두는 버퍼로서 많이 사용된다.

#### 예시]

1. 너비 우선 탐색(BFS, Breadth-First Search) 구현
2. 처리해야 할 노드의 리스트를 저장하는 용도로 큐(Queue)를 사용한다.
3. 캐시(Cache) 구현
4. 프린트 대기열
5. 선입선출이 필요한 대기열
6. 콜센터 고객 대기시간
7. 프린터의 출력 처리
8. 윈도 시스템의 메시지 처리기
9. 프로세스 관리

